*he studies the screen for clues*

I want to see.

@InfamousChild Oh good!

*has gone back to his own, relieved that they've found it*

These are really good.

@InfamousChild Ah. I think I've had Lipton's before. I like the peach.

*a pause, looking over the Master's collection*

Are you sure we'll have enough?

@InfamousChild Yes, exactly.

*he goes to study the bread*

This is the sandwich shop?

