 *lets it rest for a moment before continuing*

His story is similar to mine. I faked my death when Thanos attacked, but I didn't hide so well. I had a life on Midgard and I tried to return to it, then the TVA found me.

@OfSupremeMaster *chuckles* Are you offering me tea?

*he takes the seat*

Yes, I think I would like some.

@InfamousChild However will we cope without checking twitter.

*he heads over to the console table, leaning against it*

