@Softie_Supreme No, I can get there on my own.

*he gets to his feet*

I'll see you later today then.

@Softie_Supreme *he chuckle*

Don't worry. I have a place on Midgard where I keep things. A couple of places actually.

There's no need to go all the way to Asgard.

@Softie_Supreme I'm used to it. People who aren't wary of me are too stupid for their own good.

*takes the cheese, finishing it off*

I'll have to go home and get a change of clothes, but I would be happy to camp out in your library for a few days.

@InfamousChild *it's good that he's not going back to eating because Loki has stolen all his bacon*

*he settles back in his chair, taking a drink*

So we'll get dressed and then find a tea shop?
